zed art gallery is set to redefine cultural landscape.'=>'يېڭىلانغان سەنئەت سارىيى مەدەنىيەت مەنزىرىسىگە قايتا ئېنىقلىما بېرىدۇ.','Sub-heading of the featuresOur comprehensive suite of professional services caters to a diverse clientele, ranging from homeowners to commercial developers.'=>'كەسپىي مۇلازىمىتىمىز ھەممىنى ئۆز ئىچىگە ئالغاچقا، ئۆي ئىگىسىدىن سودا ئىجادىيىتىگىچە بولغان ھەممە خېرىدارلارنىڭ ئېھتىياجىنى قاندۇرالايدۇ.','Pattern titlePosts with featured images only, 3 columns'=>'تەۋسىيە سۈرەتلىك يازما، 3 رەت','Pattern titleGrid of posts featuring the first post, 2 columns'=>'تۇنجى يازمىنى گەۋدىلەندۈرىدىغان تورسىمان مەزمۇنلۇق يازما، 2 رەت','Pattern titleList of posts, 3 columns'=>'يازما تىزىمى، 3 رەت','Pattern titleList of posts, 1 column'=>'يازما تىزىمى، 1 رەت','Green staircase at Western University, London, Canada'=>'كانادا لوندون غەرب ئۇنىۋېرسىتېتىنىڭ يېشىل پەشتىقى','Name of RSVP landing page patternRSVP Landing Page'=>'تەكلىپنامىگە جاۋاب قايتۇرۇش بېتى','Pattern titleRSVP landing'=>'تەكلىپنامىگە جاۋاب قايتۇرۇش','Pattern titlePortfolio project overview'=>'بىرلەشمە قۇرۇلۇش ئومۇمىي ئەھۋالى','sample content for newsletter subscriptionSubscribe to the newsletter and stay connected with our community'=>'خەۋەرلەرگە مۇشتەرى بولۇپ، جامائىتىمىز بىلەن ئالاقىنى ساقلاڭ','Pattern titleNewsletter landing'=>'خەۋەر بېتى','Pattern titlePortfolio home with post featured images'=>'تەۋسىيە سۈرەتلىك يازمىنىڭ ئەسەر توپلىمى باش بېتى','Pattern titlePortfolio hero'=>'بىرلەشمە قەھرىمان','RSVP call to action descriptionExperience the fusion of imagination and expertise with Études Arch Summit, February 2025.'=>'2025-يىلى فېۋرال، بىناكارلىق تەتقىقات ئۇچرىشىشى تەسەۋۋۇر كۈچى بىلەن كەسپىي بىلىمنىڭ يۇغۇرۇلمىسىنى ھېس قىلدۇرىدۇ.','Feature for pricing levelAccess to 20 exclusive <em>Études Articles</em> per month.'=>'ھەر ئايدا مەخسۇس <em>تەتقىقات ماقالىسى</em> دىن 20 نى زىيارەت قىلالايدۇ','Feature for pricing levelExclusive, unlimited access to <em>Études Articles</em>.'=>'مەخسۇس <em>تەتقىقات ماقالىسى</em>نى چەكلىمىسىز زىيارەت قىلالايدۇ.','Sample heading for the second pricing levelConnoisseur'=>'باھالىغۇچى','Button text for the first pricing levelSubscribe'=>'خەتلەت','Feature for pricing levelExclusive access to the <em>Études</em> app for iOS and Android.'=>'<em>Études</em> نىڭ مەخسۇس iOS ۋە Android نەشرىدىكى ئەپنى ئىشلىتەلەيدۇ.','Feature for pricing levelExclusive access to the <em>Études</em> app for iOS and Android'=>'<em>Études</em> نىڭ مەخسۇس iOS ۋە Android نەشرىدىكى ئەپنى ئىشلىتەلەيدۇ','Pattern titleTitle text and button on left with image on right'=>'ماۋزۇ تېكىستى ۋە توپچە سول تەرەپتە، سۈرەت ئوڭ تەرەپتە','Description for the About patternLeaving an indelible mark on the landscape of tomorrow.'=>'ئەتىدىكى مەنزىرىگە ئۆچمەس ئىز قالدۇرغان.','Headline for the About patternÉtudes offers comprehensive consulting, management, design, and research solutions. Every architectural endeavor is an opportunity to shape the future.'=>'Études ئومۇميۈزلۈك مەسلىھەت، باشقۇرۇش، لايىھە ۋە تەتقىقات ھەل قىلىش لايىھەسى بىلەن تەمىنلەيدۇ. ھەر بىر بىناكارلىق قۇرۇلۇشى كەلگۈسى يارىتىدىغان پۇرسەتتۇر.','Watch, Read, Listen'=>'كۆزىتىپ، ئوقۇپ، ئاڭلاڭ','Descriptive text for the feature areaThe revitalized Art Gallery is set to redefine the cultural landscape of Toronto, serving as a nexus of artistic expression, community engagement, and architectural marvel. The expansion and renovation project pay homage to the Art Gallery\'s rich history while embracing the future, ensuring that the gallery remains a beacon of inspiration.'=>'يېڭىلانغان سەنئەت سارىيى تورونتونىڭ مەدەنىيەت مەنزىرىسىگە قايتىدىن ئېنىقلىما بېرىپ، سەنئەتتە ئىپادىلەيدىغان، جامائەت قاتنىشىدىغان ۋە بىناكارلىق مۆجىزە مەركىزىگە ئايلىنىدۇ. كېڭەيتىش ۋە يېڭىلاش قۇرۇلۇشى سەنئەت سارىيىنىڭ ئۇزاق تارىخىغا ھۆرمەت قىلىش بىلەن بىللە، يەنە كەلگۈسىنى باغاشلاپ، سەنئەت سارىيىنىڭ ئىلھامنىڭ ماياكى بولۇشىغا كاپالەتلىك قىلىدۇ.','Links I found useful and wanted to share.'=>'كېرەكلىك ئۇلانمىلارنى بايقىدىم، ھەمبەھىرلەشنى ئۈمىد قىلىمەن.','Message to convey that a webpage could not be foundThe page you are looking for does not exist, or it has been moved. Please try searching using the form below.'=>'سىز ئىزدەيدىغان بەت مەۋجۇت ئەمەس ياكى يۆتكىۋېتىلگەن. تۆۋەندىكى جەدۋەلنى ئىشلىتىپ ئىزدەڭ.','Feature for pricing levelWeekly print edition.'=>'ھەپتىلىك باسما نۇسخىسى.','Feature for pricing levelAccess to 5 exclusive <em>Études Articles</em> per month.'=>'ھەر ئايدا مەخسۇس <em>تەتقىقات ماقالىسى</em> دىن 5 نى زىيارەت قىلالايدۇ','Sample headingEnhance your architectural journey with the Études Architect app.'=>'Études Architect ئەپنى ئىشلىتىپ بىناكارلىق سەپىرىڭىزنى ياخشىلاڭ.','Hyatt Regency San Francisco, San Francisco, United States'=>'ئامېرىكا قوشما شىتاتلىرى سان فىرانسىسكودىكى سان فرانسىسكو Hyatt Regency مېھمانسارىيى','Sample descriptive text for a project or post.This transformative project seeks to enhance the gallery\'s infrastructure, accessibility, and exhibition spaces while preserving its rich cultural heritage.'=>'بۇ ئۆزگەرتىش قۇرۇلۇشى سۈرەتداننىڭ ئۇل ئەسلىھە، قۇلايلىق ئەسلىھە ۋە كۆرگەزمە بوشلۇقىنى كۈچەيتىپلا قالماي يەنە مەدەنىيەت مىراسلىرىنى قوغدايدۇ.','Sample description of the services patternExperience the fusion of imagination and expertise with Études—the catalyst for architectural transformations that enrich the world around us.'=>'Études ئارقىلىق تەسەۋۋۇر كۈچى بىلەن كەسپىي بىلىمنى بىرلەشتۈرۈشنى ھېس قىلدۇرۇپ، بىناكارلىق ئسلاھاتىنىڭ كاتالىزاتورى بولۇپ، ئەتراپىمىزدىكى دۇنيانى تېخىمۇ موللاشتۇرىدۇ.','Question on the details blockI\'d like to get to meet fellow architects, how can I do that?'=>'بىناكار كەسىپداشلار بىلەن تونۇشماقچى بولسام، قانداق قىلىمەن؟','Hidden answer on the details blockÉtudes offers comprehensive consulting, management, design, and research solutions. Our vision is to be at the forefront of architectural innovation, fostering a global community of architects and enthusiasts united by a passion for creating spaces. Every architectural endeavor is an opportunity to shape the future.'=>'Études ئومۇميۈزلۈك مەسلىھەت، باشقۇرۇش، لايىھە ۋە تەتقىقات ھەل قىلىش لايىھەسى بىلەن تەمىنلەيدۇ. بىزنىڭ نىشانىمىز بىناكارلىقتا يېڭىلىق يارىتىشنىڭ ئالدىنقى سېپىدە، بىناكار ۋە ھەۋەسكارلاردىن تەشكىل تاپقان بىر دۇنياۋى جامائەت يېتىشتۈرۈپ، ئۇلارنىڭ يېڭىلىق يارىتىش قىزغىنلىقىنى بىر يەرگە جۇغلاشتىن ئىبارەت. ھەر بىر بىناكارلىق قۇرۇلۇشى كەلگۈسىنى يارىتىدىغان پۇرسەتتۇر.','<em>Études</em> is not confined to the past—we are passionate about the cutting edge designs shaping our world today.'=>'<em>Études</em> ئۆتمۈش بىلەنلا چەكلەنمەيدۇ، بەلكى پۈتكۈل ۋۇجۇدى بىلەن بۈگۈنكى دۇنياغا تەسىر كۆرسىتىدىغان ئەڭ ئىلغار لايىھە يارىتىدۇ.','Sample descriptive text of the team patternOur comprehensive suite of professionals caters to a diverse team, ranging from seasoned architects to renowned engineers.'=>'تەجرىبىلىك بىناكاردىن داڭلىق ئىنژېنىرلارغىچە، بىزنىڭ كەسپىي خادىملارنىڭ سەپلىنىشى ئوخشىمىغان قوشۇنلارنىڭ ئېھتىياجىنى قاندۇرىدۇ.','the WordPress team'=>'WordPress قوشۇنى','https://wordpress.org/themes/twentytwentyfour/'=>'https://wordpress.org/themes/twentytwentyfour/']];